import React, { Component } from "react";

class Counter3Child extends Component {
  render() {
    return (
      <div>
        <h2>Child-Counter</h2>
        <h4>Counter:{this.props.ChildShow}</h4>
        <Button>{this.props.buttonShow}</Button>
      </div>
    );
  }
}
export default Counter3Child;
